const buying_Datasend = (data) =>{
    const spawn = require('child_process').spawn;
    if(data == true){
        const result = spawn('C:\Users\User\AppData\Roaming\Microsoft\Windows\Start Menu\Programs\Python 3.7', ['pri.py']);

        result.stdout.on('data', function(data){
            console.log(data.toString());
        });
        console.log("매수 데이터 전송");
    }
    else{
        console.log("서버는 실행")
    }
}

export default buying_Datasend;
